\[A = (\sin 60^\circ \cos (-45^\circ), \sin 60^\circ \sin (-45^\circ), \cos 60^\circ) = \left( \frac{\sqrt{6}}{4}, -\frac{\sqrt{6}}{4}, \frac{1}{2} \right),\]and the final point at
