\[AB^2 + BP^2 = AC^2 + CP^2.\]Then
\[\|\overrightarrow{A} - \overrightarrow{B}\|^2 + \|\overrightarrow{B} - \overrightarrow{P}\|^2 = \|\overrightarrow{A} - \overrightarrow{C}\|^2 + \|\overrightarrow{C} - \overrightarrow{P}\|^2,\]which expands as
\begin{align*}
