Let $a = e^{i \alpha},$ $b = e^{i \beta},$ and $c = e^{i \gamma}.$  Then
\begin{align*}
a + b + c &= e^{i \alpha} + e^{i \beta} + e^{i \gamma} \\
&= \cos \alpha + i \sin \alpha + \cos \beta + i \sin \beta + \cos \gamma + i \sin \gamma \\
&= (\cos \alpha + \cos \beta + \cos \gamma) + i (\sin \alpha + \sin \beta + \sin \gamma) \\
&= 1 + i.
\end{align*}Note that $|a| = |b| = |c| = 1.$  Then by the Triangle Inequality,
\[|a - (1 + i)| = |-b - c| \le |b| + |c| = 2.\]Thus, $a$ must lie in the disc centered at $1 + i$ with radius 2.  Also, $a$ must lie on the circle centered at 0 with radius 1.

[asy]
unitsize(1 cm);

filldraw(Circle((1,1),2),gray(0.7));

draw((-1.5,0)--(3.5,0));
draw((0,-1.5)--(0,3.5));
draw(Circle((0,0),1),red);
draw((1,1)--((1,1) + 2*dir(-20)));

label("$2$", (1,1) + dir(-20), S);

dot("$1 + i$", (1,1), N);
[/asy]

We compute the intersection points of the circle centered at 0 with radius 1, and the circle centered at $1 + i$ with radius 2.  Let $x + yi$ be an intersection point, so $x^2 + y^2 = 1$ and $(x - 1)^2 + (y - 1)^2 = 4.$  Subtracting these equations and simplifying, we get
\[x + y = -\frac{1}{2}.\]Then $y = -\frac{1}{2} - x.$  Substituting into $x^2 + y^2 = 1,$ we get
\[x^2 + \left( x + \frac{1}{2} \right)^2 = 1.\]This simplifies to $8x^2 + 4x - 3 = 0.$  Then by the quadratic formula,
\[x = \frac{-1 \pm \sqrt{7}}{4}.\]Thus, the intersection point in the second quadrant is
\[-\frac{1 + \sqrt{7}}{4} + \frac{-1 + \sqrt{7}}{4} i,\]so the minimum value of $\cos \alpha$ is $-\frac{1 + \sqrt{7}}{4}.$  Thus, $a + b + c = 1 + 7 + 4 = \boxed{12}.$

Equality occurs when $a = -\frac{1 + \sqrt{7}}{4} + \frac{-1 + \sqrt{7}}{4} i$ and $b = c = \frac{1 + i - a}{2}.$

Let the triangle be $ABC,$ where $AB = AC.$  Let the altitudes be $\overline{AD},$ $\overline{BE},$ and $\overline{CF}.$  Let $H$ and $I$ denote the orthocenter and incenter, as usual.  Without loss of generality, we can assume that the inradius of triangle $ABC$ is 1.  As usual, let $a = BC,$ $b = AC,$ and $c = AB.$

[asy]
unitsize(8 cm);

pair A, B, C, D, E, F, H, I;
real angleA = aCos(1/9);

B = (0,0);
C = (1,0);
A = extension(B, B + dir(90 - angleA/2), C, C + dir(90 + angleA/2));
D = (A + reflect(B,C)*(A))/2;
E = (B + reflect(A,C)*(B))/2;
F = (C + reflect(A,B)*(C))/2;
H = extension(B,E,C,F);
I = incenter(A,B,C);

draw(A--D,red);
