By the Law of Cosines,
\begin{align*}
\cos A &= \frac{5^2 + 7^2 - 8^2}{2 \cdot 5 \cdot 7} = \frac{1}{7}, \\
\cos B &= \frac{5^2 + 8^2 - 7^2}{2 \cdot 5 \cdot 8} = \frac{1}{2}, \\
\cos C &= \frac{7^2 + 8^2 - 5^2}{2 \cdot 7 \cdot 8} = \frac{11}{14}.
\end{align*}Then $BD = AB \cos B = \frac{5}{2}$ and $CD = AC \cos C = \frac{11}{2},$ so
\[\overrightarrow{D} = \frac{11}{16} \overrightarrow{B} + \frac{5}{16} \overrightarrow{C}.\]Also, $AE = AB \cos A = \frac{5}{7}$ and $CE = BC \cos C = \frac{44}{7},$ so
\[\overrightarrow{E} = \frac{44}{49} \overrightarrow{A} + \frac{5}{49} \overrightarrow{C}.\]Isolating $\overrightarrow{C}$ in these equations, we obtain
\[\overrightarrow{C} = \frac{16 \overrightarrow{D} - 11 \overrightarrow{B}}{5} = \frac{49 \overrightarrow{E} - 44 \overrightarrow{A}}{5}.\]Then $16 \overrightarrow{D} - 11 \overrightarrow{B} = 49 \overrightarrow{E} - 44 \overrightarrow{A},$ so $16 \overrightarrow{D} + 44 \overrightarrow{A} = 49 \overrightarrow{E} + 11 \overrightarrow{B},$ or
\[\frac{16}{60} \overrightarrow{D} + \frac{44}{60} \overrightarrow{A} = \frac{49}{60} \overrightarrow{E} + \frac{11}{60} \overrightarrow{B}.\]Since the coefficients on both sides of the equation add up to 1, the vector on the left side lies on line $AD,$ and the vector on the right side lies on line $BE.$  Therefore, this common vector is $\overrightarrow{H}.$  Then
\begin{align*}
